import React from "react";

function NotfoundPage() {
  return (
    <div
      style={{
        fontSize: "15vw",
        position: "absolute",
        display: "flex",
        width: "100%",
        height: "100%",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#FF91B2",
      }}
    >
      404 ,Not found
    </div>
  );
}

export default NotfoundPage;
